import React from "react";
import NAvbsr from "./NAvbsr";

function Home() {
  return (
    <>
      <NAvbsr />
      <div className="row">
        <div className="col-lg-6">
          <p>My self</p>
          <h1>PRITAM MULI</h1>
          <h5>Front-end React JS developer</h5>
        </div>
        <div className="col-lg-6"></div>
      </div>
    </>
  );
}

export default Home;
